contracts/EmergencyLogging.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";

/**
 * @title EmergencyLogging - SIH 2025 Demo
 * @dev Immutable emergency incident logging for tourists
 * @notice [32mBLOCKCHAIN VERIFIED[0m - All emergency logs are tamper-proof and auditable
 */
contract EmergencyLogging is AccessControl, ReentrancyGuard, Pausable {
	bytes32 public constant EMERGENCY_LOGGER_ROLE = keccak256("EMERGENCY_LOGGER_ROLE");
	bytes32 public constant POLICE_ROLE = keccak256("POLICE_ROLE");
	bytes32 public constant TOURISM_ROLE = keccak256("TOURISM_ROLE");

	struct EmergencyRecord {
		uint256 recordId;
		address touristWallet;
		string touristIdHash;
		string incidentType; // "panic", "missing", "distress", "medical", "crime"
		string location; // Geohash or coordinates
		string detailsHash; // IPFS hash of encrypted details
		uint256 timestamp;
		address reportedBy;
		bool resolved;
		uint256 resolvedTimestamp;
		address resolvedBy;
	}

	uint256 public totalRecords;
	mapping(uint256 => EmergencyRecord) public records;
	mapping(address => uint256[]) public walletToRecords;
	mapping(string => uint256[]) public touristIdToRecords;

	event EmergencyReported(
		uint256 indexed recordId,
		address indexed touristWallet,
		string touristIdHash,
		string incidentType,
		string location,
		uint256 timestamp,
		address reportedBy
	);

	event EmergencyResolved(
		uint256 indexed recordId,
		address indexed resolvedBy,
		uint256 resolvedTimestamp
	);

	modifier onlyLogger() {
		require(
			hasRole(EMERGENCY_LOGGER_ROLE, msg.sender) ||
			hasRole(POLICE_ROLE, msg.sender) ||
			hasRole(TOURISM_ROLE, msg.sender),
			"EmergencyLogging: Unauthorized"
		);
		_;
	}

	modifier recordExists(uint256 _recordId) {
		require(records[_recordId].recordId != 0, "EmergencyLogging: Record does not exist");
		_;
	}

	constructor() {
		_grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
		_grantRole(EMERGENCY_LOGGER_ROLE, msg.sender);
		_grantRole(POLICE_ROLE, msg.sender);
		_grantRole(TOURISM_ROLE, msg.sender);
	}

	/**
	 * @dev Report a new emergency incident
	 * @param _touristWallet Tourist wallet address
	 * @param _touristIdHash Hash of tourist ID
	 * @param _incidentType Type of incident
	 * @param _location Location string
	 * @param _detailsHash IPFS hash of encrypted details
	 */
	function reportEmergency(
		address _touristWallet,
		string memory _touristIdHash,
		string memory _incidentType,
		string memory _location,
		string memory _detailsHash
	) external onlyLogger whenNotPaused returns (uint256) {
		require(_touristWallet != address(0), "EmergencyLogging: Invalid wallet");
		require(bytes(_touristIdHash).length > 0, "EmergencyLogging: Invalid tourist ID");
		require(bytes(_incidentType).length > 0, "EmergencyLogging: Incident type required");
		require(bytes(_location).length > 0, "EmergencyLogging: Location required");
		require(bytes(_detailsHash).length > 0, "EmergencyLogging: Details required");

		totalRecords++;
		uint256 newRecordId = totalRecords;

		EmergencyRecord storage newRecord = records[newRecordId];
		newRecord.recordId = newRecordId;
		newRecord.touristWallet = _touristWallet;
		newRecord.touristIdHash = _touristIdHash;
		newRecord.incidentType = _incidentType;
		newRecord.location = _location;
		newRecord.detailsHash = _detailsHash;
		newRecord.timestamp = block.timestamp;
		newRecord.reportedBy = msg.sender;
		newRecord.resolved = false;

		walletToRecords[_touristWallet].push(newRecordId);
		touristIdToRecords[_touristIdHash].push(newRecordId);

		emit EmergencyReported(
			newRecordId,
			_touristWallet,
			_touristIdHash,
			_incidentType,
			_location,
			block.timestamp,
			msg.sender
		);

		return newRecordId;
	}

	/**
	 * @dev Resolve an emergency incident
	 * @param _recordId Emergency record ID
	 */
	function resolveEmergency(uint256 _recordId) external recordExists(_recordId) onlyLogger whenNotPaused {
		require(!records[_recordId].resolved, "EmergencyLogging: Already resolved");

		records[_recordId].resolved = true;
		records[_recordId].resolvedTimestamp = block.timestamp;
		records[_recordId].resolvedBy = msg.sender;

		emit EmergencyResolved(_recordId, msg.sender, block.timestamp);
	}

	/**
	 * @dev Get emergency records for a tourist wallet
	 * @param _wallet Tourist wallet address
	 */
	function getRecordsByWallet(address _wallet) external view returns (uint256[] memory) {
		return walletToRecords[_wallet];
	}

	/**
	 * @dev Get emergency records for a tourist ID
	 * @param _touristIdHash Tourist ID hash
	 */
	function getRecordsByTouristId(string memory _touristIdHash) external view returns (uint256[] memory) {
		return touristIdToRecords[_touristIdHash];
	}

	/**
	 * @dev Emergency pause
	 */
	function pause() external onlyRole(DEFAULT_ADMIN_ROLE) {
		_pause();
	}

	/**
	 * @dev Unpause
	 */
	function unpause() external onlyRole(DEFAULT_ADMIN_ROLE) {
		_unpause();
	}
}

contracts/IdentityRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";
// import "./interfaces/ITouristIdentity.sol"; // TODO: Implement interface

/**
 * @title IdentityRegistry
 * @dev Central registry for managing all tourist identities and verification
 * @notice Provides centralized access control and verification management
 */
contract IdentityRegistry is AccessControl, ReentrancyGuard, Pausable {
    
    // Roles
    bytes32 public constant REGISTRY_ADMIN_ROLE = keccak256("REGISTRY_ADMIN_ROLE");
    bytes32 public constant VERIFIER_ROLE = keccak256("VERIFIER_ROLE");
    bytes32 public constant EMERGENCY_ROLE = keccak256("EMERGENCY_ROLE");
    bytes32 public constant TOURISM_ROLE = keccak256("TOURISM_ROLE");
    bytes32 public constant POLICE_ROLE = keccak256("POLICE_ROLE");
    
    // Counters
    uint256 private _registrationCounter;
    uint256 private _verifierCounter;
    
    // Structs
    struct RegistryRecord {
        uint256 registryId;
        address identityContract;
        uint256 identityId;
        address touristWallet;
        string touristIdHash;
        address registeredBy;
        uint256 registrationTimestamp;
        bool isActive;
        bool isVerified;
        uint256 verificationTimestamp;
        address verifiedBy;
        string status; // "active", "suspended", "revoked", "expired"
        string location; // Registration location
    }
    
    struct VerifierInfo {
        uint256 verifierId;
        address verifierAddress;
        string organization;
        string role; // "government", "police", "embassy", "tourism_board"
        string jurisdiction;
        bool isActive;
        uint256 registeredTimestamp;
        uint256 verificationsCount;
        address registeredBy;
    }
    
    struct RegistryStats {
        uint256 totalRegistrations;
        uint256 activeIdentities;
        uint256 verifiedIdentities;
        uint256 pendingVerifications;
        uint256 revokedIdentities;
        uint256 totalVerifiers;
        uint256 activeVerifiers;
    }
    
    // Mappings
    mapping(uint256 => RegistryRecord) public registryRecords;
    mapping(address => uint256) public walletToRegistry;
    mapping(string => uint256) public touristIdToRegistry;
    mapping(address => uint256) public contractToRegistry;
    mapping(uint256 => VerifierInfo) public verifiers;
    mapping(address => uint256) public verifierAddressToId;
    mapping(string => uint256[]) public locationToIdentities;
    mapping(string => uint256[]) public statusToIdentities;
    
    // Arrays for enumeration
    uint256[] public allRegistryIds;
    uint256[] public allVerifierIds;
    
    // Contract references
    mapping(address => bool) public authorizedContracts;
    
    // Events
    event IdentityRegistered(
        uint256 indexed registryId,
        address indexed identityContract,
        uint256 indexed identityId,
        address touristWallet,
        string touristIdHash,
        uint256 timestamp
    );
    
    event IdentityVerified(
        uint256 indexed registryId,
        address indexed verifier,
        uint256 timestamp
    );
    
    event IdentityStatusChanged(
        uint256 indexed registryId,
        string oldStatus,
        string newStatus,
        address changedBy,
        uint256 timestamp
    );
    
    event VerifierRegistered(
        uint256 indexed verifierId,
        address indexed verifierAddress,
        string organization,
        string role,
        uint256 timestamp
    );
    
    event VerifierStatusChanged(
        uint256 indexed verifierId,
        bool isActive,
        address changedBy,
        uint256 timestamp
    );
    
    event EmergencyAccess(
        uint256 indexed registryId,
        address indexed accessor,
        string accessType,
        string reason,
        uint256 timestamp
    );
    
    event BulkVerification(
        uint256[] registryIds,
        address indexed verifier,
        uint256 timestamp
    );
    
    // Modifiers
    modifier onlyAuthorizedContract() {
        require(
            authorizedContracts[msg.sender],
            "IdentityRegistry: Not authorized contract"
        );
        _;
    }
    
    modifier registryExists(uint256 _registryId) {
        require(
            registryRecords[_registryId].registryId != 0,
            "IdentityRegistry: Registry record does not exist"
        );
        _;
    }
    
    modifier verifierExists(uint256 _verifierId) {
        require(
            verifiers[_verifierId].verifierId != 0,
            "IdentityRegistry: Verifier does not exist"
        );
        _;
    }
    
    constructor() {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(REGISTRY_ADMIN_ROLE, msg.sender);
        _grantRole(VERIFIER_ROLE, msg.sender);
        _grantRole(EMERGENCY_ROLE, msg.sender);
        _grantRole(TOURISM_ROLE, msg.sender);
        _grantRole(POLICE_ROLE, msg.sender);
    }
    
    /**
     * @dev Registers a new identity in the registry
     * @param _identityContract Address of the identity contract
     * @param _identityId Identity ID from the contract
     * @param _touristWallet Tourist's wallet address
     * @param _touristIdHash Hash of tourist ID
     * @param _location Registration location
     */
    function registerIdentity(
        address _identityContract,
        uint256 _identityId,
        address _touristWallet,
        string memory _touristIdHash,
        string memory _location
    ) external onlyAuthorizedContract whenNotPaused returns (uint256) {
        require(_identityContract != address(0), "IdentityRegistry: Invalid contract address");
        require(_touristWallet != address(0), "IdentityRegistry: Invalid wallet address");
        require(bytes(_touristIdHash).length > 0, "IdentityRegistry: Invalid tourist ID hash");
        require(walletToRegistry[_touristWallet] == 0, "IdentityRegistry: Wallet already registered");
        require(touristIdToRegistry[_touristIdHash] == 0, "IdentityRegistry: Tourist ID already registered");
        
        _registrationCounter++;
        uint256 newRegistryId = _registrationCounter;
        
        RegistryRecord storage newRecord = registryRecords[newRegistryId];
        newRecord.registryId = newRegistryId;
        newRecord.identityContract = _identityContract;
        newRecord.identityId = _identityId;
        newRecord.touristWallet = _touristWallet;
        newRecord.touristIdHash = _touristIdHash;
        newRecord.registeredBy = tx.origin; // Original transaction sender
        newRecord.registrationTimestamp = block.timestamp;
        newRecord.isActive = true;
        newRecord.isVerified = false;
        newRecord.status = "active";
        newRecord.location = _location;
        
        walletToRegistry[_touristWallet] = newRegistryId;
        touristIdToRegistry[_touristIdHash] = newRegistryId;
        contractToRegistry[_identityContract] = newRegistryId;
        allRegistryIds.push(newRegistryId);
        locationToIdentities[_location].push(newRegistryId);
        statusToIdentities["active"].push(newRegistryId);
        
        emit IdentityRegistered(
            newRegistryId,
            _identityContract,
            _identityId,
            _touristWallet,
            _touristIdHash,
            block.timestamp
        );
        
        return newRegistryId;
    }
    
    /**
     * @dev Verifies an identity in the registry
     * @param _registryId Registry ID to verify
     */
    function verifyIdentity(uint256 _registryId) 
        external 
        onlyRole(VERIFIER_ROLE) 
        registryExists(_registryId) 
        whenNotPaused 
    {
        require(!registryRecords[_registryId].isVerified, "IdentityRegistry: Already verified");
        require(
            keccak256(bytes(registryRecords[_registryId].status)) == keccak256(bytes("active")),
            "IdentityRegistry: Identity not active"
        );
        
        registryRecords[_registryId].isVerified = true;
        registryRecords[_registryId].verificationTimestamp = block.timestamp;
        registryRecords[_registryId].verifiedBy = msg.sender;
        
        // Update verifier statistics
        uint256 verifierId = verifierAddressToId[msg.sender];
        if (verifierId != 0) {
            verifiers[verifierId].verificationsCount++;
        }
        
        emit IdentityVerified(_registryId, msg.sender, block.timestamp);
    }
    
    /**
     * @dev Bulk verification of multiple identities
     * @param _registryIds Array of registry IDs to verify
     */
    function bulkVerifyIdentities(uint256[] memory _registryIds) 
        external 
        onlyRole(VERIFIER_ROLE) 
        whenNotPaused 
    {
        require(_registryIds.length > 0, "IdentityRegistry: Empty array");
        require(_registryIds.length <= 100, "IdentityRegistry: Too many identities");
        
        for (uint256 i = 0; i < _registryIds.length; i++) {
            uint256 registryId = _registryIds[i];
            if (registryRecords[registryId].registryId != 0 && 
                !registryRecords[registryId].isVerified &&
                keccak256(bytes(registryRecords[registryId].status)) == keccak256(bytes("active"))) {
                
                registryRecords[registryId].isVerified = true;
                registryRecords[registryId].verificationTimestamp = block.timestamp;
                registryRecords[registryId].verifiedBy = msg.sender;
                
                emit IdentityVerified(registryId, msg.sender, block.timestamp);
            }
        }
        
        // Update verifier statistics
        uint256 verifierId = verifierAddressToId[msg.sender];
        if (verifierId != 0) {
            verifiers[verifierId].verificationsCount += _registryIds.length;
        }
        
        emit BulkVerification(_registryIds, msg.sender, block.timestamp);
    }
    
    /**
     * @dev Changes identity status
     * @param _registryId Registry ID
     * @param _newStatus New status
     */
    function changeIdentityStatus(uint256 _registryId, string memory _newStatus) 
        external 
        onlyRole(REGISTRY_ADMIN_ROLE) 
        registryExists(_registryId) 
    {
        require(
            keccak256(bytes(_newStatus)) == keccak256(bytes("active")) ||
            keccak256(bytes(_newStatus)) == keccak256(bytes("suspended")) ||
            keccak256(bytes(_newStatus)) == keccak256(bytes("revoked")) ||
            keccak256(bytes(_newStatus)) == keccak256(bytes("expired")),
            "IdentityRegistry: Invalid status"
        );
        
        string memory oldStatus = registryRecords[_registryId].status;
        registryRecords[_registryId].status = _newStatus;
        
        if (keccak256(bytes(_newStatus)) != keccak256(bytes("active"))) {
            registryRecords[_registryId].isActive = false;
        } else {
            registryRecords[_registryId].isActive = true;
        }
        
        // Update status arrays
        statusToIdentities[_newStatus].push(_registryId);
        
        emit IdentityStatusChanged(_registryId, oldStatus, _newStatus, msg.sender, block.timestamp);
    }
    
    /**
     * @dev Registers a new verifier
     * @param _verifierAddress Verifier's address
     * @param _organization Organization name
     * @param _role Verifier role
     * @param _jurisdiction Jurisdiction area
     */
    function registerVerifier(
        address _verifierAddress,
        string memory _organization,
        string memory _role,
        string memory _jurisdiction
    ) external onlyRole(REGISTRY_ADMIN_ROLE) returns (uint256) {
        require(_verifierAddress != address(0), "IdentityRegistry: Invalid verifier address");
        require(bytes(_organization).length > 0, "IdentityRegistry: Organization required");
        require(verifierAddressToId[_verifierAddress] == 0, "IdentityRegistry: Verifier already registered");
        
        _verifierCounter++;
        uint256 newVerifierId = _verifierCounter;
        
        VerifierInfo storage newVerifier = verifiers[newVerifierId];
        newVerifier.verifierId = newVerifierId;
        newVerifier.verifierAddress = _verifierAddress;
        newVerifier.organization = _organization;
        newVerifier.role = _role;
        newVerifier.jurisdiction = _jurisdiction;
        newVerifier.isActive = true;
        newVerifier.registeredTimestamp = block.timestamp;
        newVerifier.verificationsCount = 0;
        newVerifier.registeredBy = msg.sender;
        
        verifierAddressToId[_verifierAddress] = newVerifierId;
        allVerifierIds.push(newVerifierId);
        
        // Grant verifier role
        _grantRole(VERIFIER_ROLE, _verifierAddress);
        
        emit VerifierRegistered(newVerifierId, _verifierAddress, _organization, _role, block.timestamp);
        
        return newVerifierId;
    }
    
    /**
     * @dev Updates verifier status
     * @param _verifierId Verifier ID
     * @param _isActive New active status
     */
    function updateVerifierStatus(uint256 _verifierId, bool _isActive) 
        external 
        onlyRole(REGISTRY_ADMIN_ROLE) 
        verifierExists(_verifierId) 
    {
        verifiers[_verifierId].isActive = _isActive;
        
        if (_isActive) {
            _grantRole(VERIFIER_ROLE, verifiers[_verifierId].verifierAddress);
        } else {
            _revokeRole(VERIFIER_ROLE, verifiers[_verifierId].verifierAddress);
        }
        
        emit VerifierStatusChanged(_verifierId, _isActive, msg.sender, block.timestamp);
    }
    
    /**
     * @dev Emergency access to registry data
     * @param _registryId Registry ID
     * @param _accessType Type of access
     * @param _reason Reason for emergency access
     */
    function emergencyAccess(
        uint256 _registryId, 
        string memory _accessType,
        string memory _reason
    ) external onlyRole(EMERGENCY_ROLE) registryExists(_registryId) returns (RegistryRecord memory) {
        require(bytes(_reason).length > 0, "IdentityRegistry: Reason required");
        
        emit EmergencyAccess(_registryId, msg.sender, _accessType, _reason, block.timestamp);
        
        return registryRecords[_registryId];
    }
    
    /**
     * @dev Gets registry statistics
     */
    function getRegistryStats() external view returns (RegistryStats memory) {
        uint256 activeCount = 0;
        uint256 verifiedCount = 0;
        uint256 pendingCount = 0;
        uint256 revokedCount = 0;
        uint256 activeVerifiers = 0;
        
        for (uint256 i = 0; i < allRegistryIds.length; i++) {
            uint256 registryId = allRegistryIds[i];
            RegistryRecord memory record = registryRecords[registryId];
            
            if (record.isActive) activeCount++;
            if (record.isVerified) verifiedCount++;
            if (!record.isVerified && record.isActive) pendingCount++;
            if (keccak256(bytes(record.status)) == keccak256(bytes("revoked"))) revokedCount++;
        }
        
        for (uint256 i = 0; i < allVerifierIds.length; i++) {
            if (verifiers[allVerifierIds[i]].isActive) activeVerifiers++;
        }
        
        return RegistryStats({
            totalRegistrations: _registrationCounter,
            activeIdentities: activeCount,
            verifiedIdentities: verifiedCount,
            pendingVerifications: pendingCount,
            revokedIdentities: revokedCount,
            totalVerifiers: _verifierCounter,
            activeVerifiers: activeVerifiers
        });
    }
    
    /**
     * @dev Gets identities by location
     * @param _location Location string
     */
    function getIdentitiesByLocation(string memory _location) 
        external 
        view 
        returns (uint256[] memory) 
    {
        return locationToIdentities[_location];
    }
    
    /**
     * @dev Gets identities by status
     * @param _status Status string
     */
    function getIdentitiesByStatus(string memory _status) 
        external 
        view 
        returns (uint256[] memory) 
    {
        return statusToIdentities[_status];
    }
    
    /**
     * @dev Authorizes a contract to register identities
     * @param _contract Contract address
     */
    function authorizeContract(address _contract) 
        external 
        onlyRole(DEFAULT_ADMIN_ROLE) 
    {
        authorizedContracts[_contract] = true;
    }
    
    /**
     * @dev Revokes contract authorization
     * @param _contract Contract address
     */
    function revokeContractAuthorization(address _contract) 
        external 
        onlyRole(DEFAULT_ADMIN_ROLE) 
    {
        authorizedContracts[_contract] = false;
    }
    
    /**
     * @dev Gets registry record by wallet
     * @param _wallet Wallet address
     */
    function getRegistryByWallet(address _wallet) 
        external 
        view 
        returns (RegistryRecord memory) 
    {
        uint256 registryId = walletToRegistry[_wallet];
        require(registryId != 0, "IdentityRegistry: No registry found for wallet");
        
        return registryRecords[registryId];
    }
    
    /**
     * @dev Gets registry record by tourist ID
     * @param _touristIdHash Tourist ID hash
     */
    function getRegistryByTouristId(string memory _touristIdHash) 
        external 
        view 
        returns (RegistryRecord memory) 
    {
        uint256 registryId = touristIdToRegistry[_touristIdHash];
        require(registryId != 0, "IdentityRegistry: No registry found for tourist ID");
        
        return registryRecords[registryId];
    }
    
    /**
     * @dev Emergency pause
     */
    function pause() external onlyRole(DEFAULT_ADMIN_ROLE) {
        _pause();
    }
    
    /**
     * @dev Unpause
     */
    function unpause() external onlyRole(DEFAULT_ADMIN_ROLE) {
        _unpause();
    }
}

contracts/IdentityVerification.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";

/**
 * @title IdentityVerification - SIH 2025 Demo
 * @dev Smart contract for validating tourist digital identities
 * @notice [32mBLOCKCHAIN VERIFIED[0m - All verification actions are cryptographically logged
 */
contract IdentityVerification is AccessControl, ReentrancyGuard, Pausable {
	bytes32 public constant VERIFIER_ROLE = keccak256("VERIFIER_ROLE");
	bytes32 public constant POLICE_ROLE = keccak256("POLICE_ROLE");
	bytes32 public constant TOURISM_ROLE = keccak256("TOURISM_ROLE");

	struct VerificationRecord {
		uint256 verificationId;
		address touristWallet;
		string touristIdHash;
		string verificationType; // "kyc", "biometric", "document", "manual"
		string detailsHash; // IPFS hash of verification details
		uint256 timestamp;
		address verifiedBy;
		bool isValid;
	}

	uint256 public totalVerifications;
	mapping(uint256 => VerificationRecord) public verifications;
	mapping(address => uint256[]) public walletToVerifications;
	mapping(string => uint256[]) public touristIdToVerifications;

	event IdentityVerified(
		uint256 indexed verificationId,
		address indexed touristWallet,
		string touristIdHash,
		string verificationType,
		uint256 timestamp,
		address verifiedBy,
		bool isValid
	);

	modifier onlyVerifier() {
		require(
			hasRole(VERIFIER_ROLE, msg.sender) ||
			hasRole(POLICE_ROLE, msg.sender) ||
			hasRole(TOURISM_ROLE, msg.sender),
			"IdentityVerification: Unauthorized"
		);
		_;
	}

	modifier verificationExists(uint256 _verificationId) {
		require(verifications[_verificationId].verificationId != 0, "IdentityVerification: Verification does not exist");
		_;
	}

	constructor() {
		_grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
		_grantRole(VERIFIER_ROLE, msg.sender);
		_grantRole(POLICE_ROLE, msg.sender);
		_grantRole(TOURISM_ROLE, msg.sender);
	}

	/**
	 * @dev Verify a tourist identity
	 * @param _touristWallet Tourist wallet address
	 * @param _touristIdHash Hash of tourist ID
	 * @param _verificationType Type of verification
	 * @param _detailsHash IPFS hash of verification details
	 * @param _isValid Is the identity valid
	 */
	function verifyIdentity(
		address _touristWallet,
		string memory _touristIdHash,
		string memory _verificationType,
		string memory _detailsHash,
		bool _isValid
	) external onlyVerifier whenNotPaused returns (uint256) {
		require(_touristWallet != address(0), "IdentityVerification: Invalid wallet");
		require(bytes(_touristIdHash).length > 0, "IdentityVerification: Invalid tourist ID");
		require(bytes(_verificationType).length > 0, "IdentityVerification: Verification type required");
		require(bytes(_detailsHash).length > 0, "IdentityVerification: Details required");

		totalVerifications++;
		uint256 newVerificationId = totalVerifications;

		VerificationRecord storage newRecord = verifications[newVerificationId];
		newRecord.verificationId = newVerificationId;
		newRecord.touristWallet = _touristWallet;
		newRecord.touristIdHash = _touristIdHash;
		newRecord.verificationType = _verificationType;
		newRecord.detailsHash = _detailsHash;
		newRecord.timestamp = block.timestamp;
		newRecord.verifiedBy = msg.sender;
		newRecord.isValid = _isValid;

		walletToVerifications[_touristWallet].push(newVerificationId);
		touristIdToVerifications[_touristIdHash].push(newVerificationId);

		emit IdentityVerified(
			newVerificationId,
			_touristWallet,
			_touristIdHash,
			_verificationType,
			block.timestamp,
			msg.sender,
			_isValid
		);

		return newVerificationId;
	}

	/**
	 * @dev Get verification records for a tourist wallet
	 * @param _wallet Tourist wallet address
	 */
	function getVerificationsByWallet(address _wallet) external view returns (uint256[] memory) {
		return walletToVerifications[_wallet];
	}

	/**
	 * @dev Get verification records for a tourist ID
	 * @param _touristIdHash Tourist ID hash
	 */
	function getVerificationsByTouristId(string memory _touristIdHash) external view returns (uint256[] memory) {
		return touristIdToVerifications[_touristIdHash];
	}

	/**
	 * @dev Emergency pause
	 */
	function pause() external onlyRole(DEFAULT_ADMIN_ROLE) {
		_pause();
	}

	/**
	 * @dev Unpause
	 */
	function unpause() external onlyRole(DEFAULT_ADMIN_ROLE) {
		_unpause();
	}
}

contracts/TouristIdentity.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";

/**
 * @title TouristIdentity - Enhanced for SIH 2025 Demo
 * @dev Smart contract for managing individual tourist digital identities
 * @notice  BLOCKCHAIN VERIFIED - Stores encrypted KYC data, trip information, and emergency contacts
 * 
 *  IMMUTABLE BLOCKCHAIN RECORDS - All tourist data permanently stored
 *  MILITARY-GRADE ENCRYPTION - AES-256 cryptographic security
 *  FULLY DECENTRALIZED - No single point of failure
 *  TAMPER-PROOF SYSTEM - Cryptographic hashes prevent manipulation
 *  BLOCKCHAIN VERIFIED - Every transaction cryptographically verified
 */
contract TouristIdentity is AccessControl, ReentrancyGuard, Pausable {
    
    // Enhanced Roles for BLOCKCHAIN VERIFIED Access Control
    bytes32 public constant VERIFIER_ROLE = keccak256("VERIFIER_ROLE");
    bytes32 public constant EMERGENCY_ROLE = keccak256("EMERGENCY_ROLE");
    bytes32 public constant TOURISM_ROLE = keccak256("TOURISM_ROLE");
    bytes32 public constant KYC_PROVIDER_ROLE = keccak256("KYC_PROVIDER_ROLE");
    bytes32 public constant GOVERNMENT_ROLE = keccak256("GOVERNMENT_ROLE");
    
    // Counter for identity IDs
    uint256 private _identityIdCounter;
    
    // Enhanced KYC Data Structure - BLOCKCHAIN VERIFIED
    struct KYCData {
        string documentType; // "passport", "aadhaar", "driving_license", "voter_id"
        string documentHash; //  IPFS hash of encrypted document
        string fullNameHash; //  Hash of full name for privacy
        string nationalityHash; //  Hash of nationality
        uint256 verificationTimestamp; //  VERIFICATION TIMESTAMP
        address verifiedBy; //  VERIFIED BY AUTHORITY
        bool isVerified; //  BLOCKCHAIN VERIFIED STATUS
        uint256 expiryTimestamp; //  EXPIRY TIMESTAMP
        uint256 trustScore; //  TRUST SCORE (0-100)
        string biometricHash; //  BIOMETRIC VERIFICATION HASH
    }
    
    struct TripData {
        string itineraryHash; // IPFS hash of encrypted itinerary
        uint256 startTimestamp;
        uint256 endTimestamp;
        string purpose; // "tourism", "business", "transit", "medical", "education"
        uint8 groupSize;
        string accommodationHash; // IPFS hash of accommodation details
    }
    
    struct EmergencyContact {
        string nameHash; // Hash of contact name
        string relationship;
        string phoneHash; // Hash of phone number
        string emailHash; // Hash of email
        bool isPrimary;
    }
    
    struct DigitalIdentity {
        uint256 identityId;
        address touristWallet;
        string touristIdHash; // Hash of government-issued tourist ID
        KYCData kycData;
        TripData tripData;
        EmergencyContact[] emergencyContacts;
        uint256 createdTimestamp;
        uint256 lastUpdatedTimestamp;
        bool isActive;
        bool isRevoked;
    }
    
    // Mappings
    mapping(uint256 => DigitalIdentity) public identities;
    mapping(address => uint256) public walletToIdentity;
    mapping(string => uint256) public touristIdToIdentity;
    
    // Events
    event IdentityCreated(
        uint256 indexed identityId,
        address indexed touristWallet,
        string touristIdHash,
        uint256 timestamp
    );
    
    event IdentityVerified(
        uint256 indexed identityId,
        address indexed verifier,
        uint256 timestamp
    );
    
    event IdentityUpdated(
        uint256 indexed identityId,
        address indexed updatedBy,
        uint256 timestamp
    );
    
    event IdentityRevoked(
        uint256 indexed identityId,
        address indexed revokedBy,
        string reason,
        uint256 timestamp
    );
    
    event EmergencyAccess(
        uint256 indexed identityId,
        address indexed accessor,
        string accessReason,
        uint256 timestamp
    );
    
    event TripStarted(
        uint256 indexed identityId,
        uint256 startTimestamp
    );
    
    event TripEnded(
        uint256 indexed identityId,
        uint256 endTimestamp
    );
    
    // Modifiers
    modifier onlyIdentityOwner(uint256 _identityId) {
        require(
            identities[_identityId].touristWallet == msg.sender,
            "TouristIdentity: Not identity owner"
        );
        _;
    }
    
    modifier identityExists(uint256 _identityId) {
        require(
            identities[_identityId].identityId != 0,
            "TouristIdentity: Identity does not exist"
        );
        _;
    }
    
    modifier identityActive(uint256 _identityId) {
        require(
            identities[_identityId].isActive && !identities[_identityId].isRevoked,
            "TouristIdentity: Identity not active"
        );
        _;
    }
    
    constructor() {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(VERIFIER_ROLE, msg.sender);
        _grantRole(EMERGENCY_ROLE, msg.sender);
        _grantRole(TOURISM_ROLE, msg.sender);
    }
    
    /**
     * @dev Creates a new digital identity for a tourist
     * @param _touristWallet Address of the tourist's wallet
     * @param _touristIdHash Hash of government-issued tourist ID
     * @param _kycData KYC information
     * @param _tripData Trip information
     */
    function createIdentity(
        address _touristWallet,
        string memory _touristIdHash,
        KYCData memory _kycData,
        TripData memory _tripData
    ) external whenNotPaused returns (uint256) {
        require(_touristWallet != address(0), "TouristIdentity: Invalid wallet address");
        require(bytes(_touristIdHash).length > 0, "TouristIdentity: Invalid tourist ID hash");
        require(walletToIdentity[_touristWallet] == 0, "TouristIdentity: Wallet already has identity");
        require(touristIdToIdentity[_touristIdHash] == 0, "TouristIdentity: Tourist ID already exists");
        
        _identityIdCounter++;
        uint256 newIdentityId = _identityIdCounter;
        
        DigitalIdentity storage newIdentity = identities[newIdentityId];
        newIdentity.identityId = newIdentityId;
        newIdentity.touristWallet = _touristWallet;
        newIdentity.touristIdHash = _touristIdHash;
        newIdentity.kycData = _kycData;
        newIdentity.tripData = _tripData;
        newIdentity.createdTimestamp = block.timestamp;
        newIdentity.lastUpdatedTimestamp = block.timestamp;
        newIdentity.isActive = true;
        newIdentity.isRevoked = false;
        
        walletToIdentity[_touristWallet] = newIdentityId;
        touristIdToIdentity[_touristIdHash] = newIdentityId;
        
        emit IdentityCreated(newIdentityId, _touristWallet, _touristIdHash, block.timestamp);
        
        return newIdentityId;
    }
    
    /**
     * @dev Adds emergency contact to an identity
     * @param _identityId Identity ID
     * @param _contact Emergency contact information
     */
    function addEmergencyContact(
        uint256 _identityId,
        EmergencyContact memory _contact
    ) external identityExists(_identityId) onlyIdentityOwner(_identityId) {
        require(
            identities[_identityId].emergencyContacts.length < 5,
            "TouristIdentity: Maximum 5 emergency contacts allowed"
        );
        
        identities[_identityId].emergencyContacts.push(_contact);
        identities[_identityId].lastUpdatedTimestamp = block.timestamp;
        
        emit IdentityUpdated(_identityId, msg.sender, block.timestamp);
    }
    
    /**
     * @dev Verifies an identity (only verifiers can call)
     * @param _identityId Identity ID to verify
     */
    function verifyIdentity(uint256 _identityId) 
        external 
        onlyRole(VERIFIER_ROLE) 
        identityExists(_identityId) 
        whenNotPaused 
    {
        require(!identities[_identityId].kycData.isVerified, "TouristIdentity: Already verified");
        
        identities[_identityId].kycData.isVerified = true;
        identities[_identityId].kycData.verifiedBy = msg.sender;
        identities[_identityId].kycData.verificationTimestamp = block.timestamp;
        identities[_identityId].lastUpdatedTimestamp = block.timestamp;
        
        emit IdentityVerified(_identityId, msg.sender, block.timestamp);
    }
    
    /**
     * @dev Updates trip data
     * @param _identityId Identity ID
     * @param _tripData New trip data
     */
    function updateTripData(
        uint256 _identityId,
        TripData memory _tripData
    ) external identityExists(_identityId) onlyIdentityOwner(_identityId) {
        identities[_identityId].tripData = _tripData;
        identities[_identityId].lastUpdatedTimestamp = block.timestamp;
        
        emit IdentityUpdated(_identityId, msg.sender, block.timestamp);
    }
    
    /**
     * @dev Starts a trip
     * @param _identityId Identity ID
     */
    function startTrip(uint256 _identityId) 
        external 
        identityExists(_identityId) 
        identityActive(_identityId)
        onlyIdentityOwner(_identityId) 
    {
        require(
            identities[_identityId].kycData.isVerified,
            "TouristIdentity: Identity must be verified to start trip"
        );
        
        identities[_identityId].tripData.startTimestamp = block.timestamp;
        identities[_identityId].lastUpdatedTimestamp = block.timestamp;
        
        emit TripStarted(_identityId, block.timestamp);
    }
    
    /**
     * @dev Ends a trip
     * @param _identityId Identity ID
     */
    function endTrip(uint256 _identityId) 
        external 
        identityExists(_identityId) 
        onlyIdentityOwner(_identityId) 
    {
        require(
            identities[_identityId].tripData.startTimestamp > 0,
            "TouristIdentity: Trip not started"
        );
        require(
            identities[_identityId].tripData.endTimestamp == 0,
            "TouristIdentity: Trip already ended"
        );
        
        identities[_identityId].tripData.endTimestamp = block.timestamp;
        identities[_identityId].lastUpdatedTimestamp = block.timestamp;
        
        emit TripEnded(_identityId, block.timestamp);
    }
    
    /**
     * @dev Emergency access to identity data
     * @param _identityId Identity ID
     * @param _accessReason Reason for emergency access
     */
    function emergencyAccess(uint256 _identityId, string memory _accessReason) 
        external 
        onlyRole(EMERGENCY_ROLE) 
        identityExists(_identityId) 
        returns (DigitalIdentity memory) 
    {
        require(bytes(_accessReason).length > 0, "TouristIdentity: Access reason required");
        
        emit EmergencyAccess(_identityId, msg.sender, _accessReason, block.timestamp);
        
        return identities[_identityId];
    }
    
    /**
     * @dev Revokes an identity
     * @param _identityId Identity ID to revoke
     * @param _reason Reason for revocation
     */
    function revokeIdentity(uint256 _identityId, string memory _reason) 
        external 
        onlyRole(DEFAULT_ADMIN_ROLE) 
        identityExists(_identityId) 
    {
        require(!identities[_identityId].isRevoked, "TouristIdentity: Already revoked");
        require(bytes(_reason).length > 0, "TouristIdentity: Reason required");
        
        identities[_identityId].isRevoked = true;
        identities[_identityId].isActive = false;
        identities[_identityId].lastUpdatedTimestamp = block.timestamp;
        
        emit IdentityRevoked(_identityId, msg.sender, _reason, block.timestamp);
    }
    
    /**
     * @dev Gets identity information
     * @param _identityId Identity ID
     */
    function getIdentity(uint256 _identityId) 
        external 
        view 
        identityExists(_identityId) 
        returns (DigitalIdentity memory) 
    {
        require(
            identities[_identityId].touristWallet == msg.sender ||
            hasRole(TOURISM_ROLE, msg.sender) ||
            hasRole(EMERGENCY_ROLE, msg.sender) ||
            hasRole(VERIFIER_ROLE, msg.sender),
            "TouristIdentity: Unauthorized access"
        );
        
        return identities[_identityId];
    }
    
    /**
     * @dev Gets identity by wallet address
     * @param _wallet Wallet address
     */
    function getIdentityByWallet(address _wallet) 
        external 
        view 
        returns (DigitalIdentity memory) 
    {
        uint256 identityId = walletToIdentity[_wallet];
        require(identityId != 0, "TouristIdentity: No identity found for wallet");
        
        return this.getIdentity(identityId);
    }
    
    /**
     * @dev Checks if identity is verified
     * @param _identityId Identity ID
     */
    function isIdentityVerified(uint256 _identityId) 
        external 
        view 
        identityExists(_identityId) 
        returns (bool) 
    {
        return identities[_identityId].kycData.isVerified;
    }
    
    /**
     * @dev Gets total number of identities
     */
    function getTotalIdentities() external view returns (uint256) {
        return _identityIdCounter;
    }
    
    /**
     * @dev Emergency pause (only admin)
     */
    function pause() external onlyRole(DEFAULT_ADMIN_ROLE) {
        _pause();
    }
    
    /**
     * @dev Unpause (only admin)
     */
    function unpause() external onlyRole(DEFAULT_ADMIN_ROLE) {
        _unpause();
    }
    
    /**
     * @dev Grants verifier role
     * @param _verifier Address to grant verifier role
     */
    function grantVerifierRole(address _verifier) 
        external 
        onlyRole(DEFAULT_ADMIN_ROLE) 
    {
        _grantRole(VERIFIER_ROLE, _verifier);
    }
    
    /**
     * @dev Grants emergency role
     * @param _emergency Address to grant emergency role
     */
    function grantEmergencyRole(address _emergency) 
        external 
        onlyRole(DEFAULT_ADMIN_ROLE) 
    {
        _grantRole(EMERGENCY_ROLE, _emergency);
    }
    
    /**
     * @dev Grants tourism role
     * @param _tourism Address to grant tourism role
     */
    function grantTourismRole(address _tourism) 
        external 
        onlyRole(DEFAULT_ADMIN_ROLE) 
    {
        _grantRole(TOURISM_ROLE, _tourism);
    }
}

